def find_primes_between_indices(num_list):
    def is_prime(num):
        if num < 2: 
            return False
        for i in range(2, num):
            if num % i == 0:
                return False
        return True
    primes_list = []
    for num in num_list[1:6]:
        if is_prime(num):
            primes_list.append(num)
    return sorted(primes_list)
